import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [resp, setResp] = useState([])

  const a = fetch('https://jsonplaceholder.typicode.com/todos/1')
        .then(response => {
          const data = response.json()
          setResp(data)
          return data
        })
        .catch(e => console.log(e))

  return (
    <div className="App">
     {console.log(a)}
    </div>
  );
}

export default App;
